// App.js

import React from "react";
import { BrowserRouter as Router, Route, Switch, useHistory } from "react-router-dom";
import Header from "./Header";
import HomeConts1 from "./HomeConts1";
import HomeConts2 from "./HomeConts2";
import HomeConts3 from "./HomeConts3";
import HomeConts4 from "./HomeConts4";

const App = () => {
  const history = useHistory();

  const handleNavigation = (path) => {
    history.push(path);
  };

  return (
    <Router>
      <Header handleNavigation={handleNavigation} />
      <Switch>
        <Route path="/" exact component={HomeConts1} />
        <Route path="/about" component={HomeConts2} />
        <Route path="/projects" component={HomeConts3} />
        <Route path="/contact" component={HomeConts4} />
      </Switch>
    </Router>
  );
};

export default App;
